import React from "react"
import { Link } from "react-router-dom"
export default function Header(){
    return(
        <div>
            <Link to={'/'}>Home</Link>
            <Link to={'Our Apartament/'}>Our Apartament</Link>
            <Link to={'Rio/'}>Rio</Link>
            <Link to={'Contact/'}>Contact</Link>
            <Link to={'/Book'}>Book</Link>
        </div>
    )
}
